      SELECT ALL - 10 * + tab1.col2 + + ( + col0 ) * col2 + ( col2 * col0 ) AS col0 FROM tab1 (FORMAT parquet);
  - name: tab1

outputs:
  - name: q9626.out
    data: |
      -216
      14400
      6726
